function drawAjaxError(o, e, t) {
  return (
    console.log(o),
    console.log(e),
    console.log(t),
    `
  <h4 style="margin-bottom: 4px;">Error Occured</h4>
  <span style="font-size: .75em;">Detailed Below</span>
  <p>${o.responseText}</p>`
  );
}
